import React, { Component } from "react";
import ReactDOM from "react-dom/client";


class FileUpload extends Component {
  constructor(props) {
    super(props);
        
    this.state = {
      pdfUrl: null, 
      file: null, // Store the selected file
      fileName: ''
    };

    this.handleFileUpload = this.handleFileUpload.bind(this);
    this.handleFileChange = this.handleFileChange.bind(this);
    this.triggerFileInput = this.triggerFileInput.bind(this);
  }

  handleFileChange = (event) => {
    this.setState({ 
      file: event.target.files[0] });
  };

  triggerFileInput = () => {
    document.getElementById('fileInput').click();
  }

  handleFileUpload = async (event) => {
    event.preventDefault();

    if (!this.state.file) {
      alert("Please select a file first.");
      return;
    }

    const formData = new FormData();
    formData.append("upfile", this.state.file);

    try {
      const response = await fetch("/api/fileupload", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error("File upload failed");
      }

      const data = await response.json(); // Get file details from backend
      this.setState({ 
        pdfUrl: `/uploads/${data.name}`,
        file: null,
        fileName: data.name
      });

    } catch (error) {
      console.error("Error uploading file:", error);
    }
  }

  render() {
    return (
      <div>

        {/* File Upload Form */}
        <form onSubmit={this.handleFileUpload}>
          <div class="grid1">

            <div id="chooseFile">
              <button className="inputButton" type="button" onClick={this.triggerFileInput}>
                Choose File
              </button>
            </div>
            
            <div id="fileNameBeforeUpload">
              <p>{this.state.file ? this.state.file.name : ''}</p>
            </div>

            <input 
              type="file" 
              id="fileInput" 
              accept="application/pdf" 
              onChange={this.handleFileChange}
            />

            <div id="Upload">
              <button className="inputButton" type="submit">Upload</button>
            </div>

          </div>
        </form>

        <h3>File Preview:</h3>

        {/* File Preview */}
        {this.state.pdfUrl && (
          <div>
            <p>
              <a href={this.state.pdfUrl} download>
                Download {this.state.fileName}
              </a>
            </p>
          </div>
        )}
      </div>
    );
  }
}

// export default FileUpload;

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <FileUpload />
  </React.StrictMode>
);
